LISTA DE TRAIÇÕES DO BOLSONARO: 

1- O ATUAL PRESIDENTE SANCIONOU O FUNDÃO ELEITORAL PARA PARTIDO CORRUPTO COMO O PT FAZER CAMPANHA;

2- O ATUAL PRESIDENTE SANCIONOU O JUIZ DE GARANTIAS ( UMA EMENDA DO FREIXO DO PSOL PARTIDO SOCIALISTA) ;

3- O ATUAL PRESIDENTE SANCIONOU A LEI DE ABUSO DE AUTORIDADE;

4- O ATUAL PRESIDENTE SANCIONOU A RESTRIÇÃO DA PRISÃO PREVENTIVA;

5- O ATUAL PRESIDENTE SANCIONOU PAGAMENTOS DE ADVOGADOS COM O FUNDO PARTIDÁRIO;

6- O ATUAL PRESIDENTE SANCIONOU A MUDANÇA DO COAF PARA O BANCO CENTRAL;

7- O ATUAL PRESIDENTE COLOCOU UM PETISTA NA PGR Q DEU FESTINHA PRA ZÉ DIRCEU;

8- O ATUAL PRESIDENTE NOMEOU ANDRÉ MENDONÇA NA AGU;

9- O ATUAL PRESIDENTE COLOCOU ADMAR GONZAGA EX ADVOGADO DA DILMA COMO SECRETÁRIO-GERAL DO 
ALIANÇA;

10- O ATUAL PRESIDENTE NAO DEMITIU LARANJAS DO GOVERNO (CHEFE DA SECOM E MINISTRO DO TURISMO);

11- O ATUAL PRESIDENTE CONDECOROU MAIA, ALCOLUMBRE E TOFFOLI;

12- O ATUAL PRESIDENTE DESMENTIU COMPROMISSO DE CAMPANHA EM INDICAR MORO NA 1 VAGA DO STF;

13- O ATUAL PRESIDENTE DESCUMPRIU COMPROMISSO DE CAMPANHA E NAO FECHOU A TV ESTATAL EBC DO GOVERNO;

14- O ATUAL PRESIDENTE DESCUMPRIU COMPROMISSO DE CAMPANHA SOBRE REAJUSTAR TABELA DE IMPOSTO DE RENDA;

15- O ATUAL PRESIDENTE BATEU RECORDE NA LIBERAÇÃO DE EMENDAS A PARLAMENTARES EM 2019, DESCUMPRINDO COMPROMISSO DE CAMPANHA SOBRE ACABAR COM O FAMOSO "TOMA LÁ, DA CÁ";

16- O ATUAL PRESIDENTE GASTOU MAIS NO CARTÃO CORPORATIVO Q DILMA E TEMER E OCULTOU OS GASTOS DESCUMPRINDO COMPROMISSO DE CAMPANHA SOBRE A TRANSPARÊNCIA NO GOVERNO;

17- O ATUAL PRESIDENTE DESCUMPRIU COMPROMISSO DE CAMPANHA DE ACABAR COM O INDULTO PARA CRIMINOSOS;

18- O ATUAL PRESIDENTE CHAMOU UMA PANDEMIA GLOBAL DE "FANTASIA", "GRIPEZINHA" E "RESFRIADINHO", CONTRARIANDO OS PRÓPRIOS ALIADOS NO CENÁRIO INTERNACIONAL COMO TRUMP E BORIS JOHNSON;

19- O ATUAL PRESIDENTE CONVOCOU SEUS ELEITORES PARA MANIFESTAÇÃO EM ÉPOCA DE PANDEMIA GLOBAL;

20- O ATUAL PRESIDENTE FEZ 2 MINISTROS DA SAÚDE SAIR POR DIVERGÊNCIAS IDEOLÓGICAS EM MEIO A UMA PANDEMIA, DESCUMPRINDO COMPROMISSO DE CAMPANHA SOBRE MINISTÉRIOS TÉCNICOS SEM O VIÉS 
IDEOLÓGICO;

21- O ATUAL PRESIDENTE DESCUMPRIU COMPROMISSO DE CAMPANHA SOBRE O FIM DA REELEIÇÃO EM REFORMA POLÍTICA;

22- O ATUAL PRESIDENTE DESCUMPRIU COMPROMISSO DE CAMPANHA SOBRE REDUZIR A CARGA TRIBUTÁRIA BRUTA E DESONERAR A FOLHA DE PAGAMENTO;

23- O ATUAL PRESIDENTE QUIS INDICAR O PRÓPRIO FILHO PARA SER EMBAIXADOR;

24- O ATUAL PRESIDENTE NA REFORMA ELEITORAL, SANCIONOU A PERMISSÃO DE GASTOS DE VERBA PÚBLICA COM ADVOGADOS E CONTABILISTAS SEM ENTRAR NO TETO DE GASTOS;

25- O ATUAL PRESIDENTE SANCIONOU A LEI QUE ACABA COM O VOTO DE QUALIDADE DO CARF, BENEFICIANDO INVESTIGADOS NO TRIBUNAL DA RECEITA;

26- O ATUAL PRESIDENTE SANCIONOU A LIMITAÇÃO DA DELAÇÃO PREMIADA;

27- O ATUAL PRESIDENTE INTERFERIU NA PF DO RIO DE JANEIRO A MANDO DO FILHO PARA BARRAR INVESTIGAÇÕES;




